import React, { useEffect, useState } from 'react';

const PlayerPicksPage = () => {
  const [week, setWeek] = useState(1);
  const [games, setGames] = useState([]);
  const [selectedPicks, setSelectedPicks] = useState([]);
  const [playerName, setPlayerName] = useState('');
  const [confirmation, setConfirmation] = useState('');

  useEffect(() => {
    fetch(`http://localhost:4000/api/games?week=${week}`)
      .then(res => res.json())
      .then(data => setGames(data))
      .catch(err => console.error('Error loading games:', err));
  }, [week]);

  const handlePick = (team) => {
    if (selectedPicks.includes(team)) {
      setSelectedPicks(selectedPicks.filter(t => t !== team));
    } else if (selectedPicks.length < 10) {
      setSelectedPicks([...selectedPicks, team]);
    }
  };

  const handleSubmit = () => {
    if (!playerName || selectedPicks.length !== 10) {
      alert('Enter your name and select exactly 10 teams.');
      return;
    }

    fetch('http://localhost:4000/api/picks', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ name: playerName, picks: selectedPicks, week }),
    })
      .then(res => res.json())
      .then(() => {
        setConfirmation('✅ Picks submitted successfully!');
        setSelectedPicks([]);
        setPlayerName('');
        setTimeout(() => setConfirmation(''), 4000);
      })
      .catch(err => {
        console.error('Submission error:', err);
        setConfirmation('❌ Something went wrong. Please try again.');
        setTimeout(() => setConfirmation(''), 4000);
      });
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h2>Weekly Picks</h2>

      <div style={{ marginBottom: '15px' }}>
        <label style={{ marginRight: '10px' }}>Choose Week:</label>
        <select value={week} onChange={(e) => setWeek(Number(e.target.value))}>
          {[...Array(16)].map((_, i) => (
            <option key={i + 1} value={i + 1}>Week {i + 1}</option>
          ))}
        </select>
      </div>

      <input
        type="text"
        placeholder="Enter your game name"
        value={playerName}
        onChange={(e) => setPlayerName(e.target.value)}
        style={{ padding: '5px', marginBottom: '10px', width: '250px' }}
      />

      <table border="1" cellPadding="8" style={{ width: '100%', marginTop: '10px', marginBottom: '15px' }}>
        <thead>
          <tr>
            <th>Date</th>
            <th>Time</th>
            <th>Matchup & Spread</th>
            <th>Pick</th>
          </tr>
        </thead>
        <tbody>
          {games.map((game, idx) => (
            <tr key={idx}>
              <td>{game.date}</td>
              <td>{game.time}</td>
              <td>{game.awayTeam} @ {game.homeTeam} ({game.spread})</td>
              <td>
                <button
                  onClick={() => handlePick(game.awayTeam)}
                  style={{ marginRight: '5px' }}
                >
                  {selectedPicks.includes(game.awayTeam) ? '✅' : 'Pick'} {game.awayTeam}
                </button>
                <button onClick={() => handlePick(game.homeTeam)}>
                  {selectedPicks.includes(game.homeTeam) ? '✅' : 'Pick'} {game.homeTeam}
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <button onClick={handleSubmit} disabled={selectedPicks.length !== 10 || !playerName}>
        Submit Picks
      </button>

      {confirmation && (
        <p style={{ marginTop: '10px', color: confirmation.startsWith('✅') ? 'green' : 'red' }}>
          {confirmation}
        </p>
      )}
    </div>
  );
};

export default PlayerPicksPage;
